// react
import React, { useState, Fragment } from "react";

// third part
import { Layout, Divider } from "antd";

// custom
import { CustomDrawerButton, HeaderTitle } from "../../../../custom/";
import * as All from "./";

// services
import { getTable } from "../../../../../services/tableServices";

const { Content } = Layout;

const TableContent = () => {
  const [table, setTable] = useState([]);
  return (
    <Fragment>
      <Content style={{ margin: "2em 16px" }}>
        <div style={{ background: "#fff", padding: 24, minHeight: 280 }}>
          <HeaderTitle title="Table Menu" />
          <CustomDrawerButton title="Add" showDrawer />
          <Divider />
          <All.Table />
        </div>
      </Content>
    </Fragment>
  );
};

export default TableContent;
